// SPDX-License-Identifier: Apache-2.0
import { UInt } from "../codec/UInt.js";
/**
 * @name u32
 * @description
 * A 32-bit unsigned integer
 */

export class u32 extends UInt.with(32) {
  constructor(...args) {
    super(...args);
    this.__UIntType = 'u32';
  }

}
